export default {
  name: 'std_but',
  props: {
    text: String
  },

  data() {
    return {
      count: 0
    };
  },

  methods: {
    clicked() {
      this.count++;
      window.$cookies.set(this.text, parseInt(window.$cookies.get(this.text)) + 1);
      this.$emit('pressed-button', this.text.concat(1));
    }

  }
};
